INSERT INTO `bio_content` VALUES ('14', '85', 'Bioflu Information', 'bioflu-information', '', '', '1', '2', '2015-08-10 17:04:39', '346', '', '2015-09-16 09:09:36', '346', '0', '0000-00-00 00:00:00', '2015-08-10 17:04:39', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', '112', '3', '', '', '1', '1046', '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', '0', '*', '', null);
INSERT INTO `bio_content` VALUES ('15', '89', 'Avoid these flu-prone areas during the rainy season', 'avoid-these-flu-prone-areas-during-the-rainy-season', '<div class=\"col-md-8 articles\">\n<div class=\"col-md-12\">\n<h2><label>Avoid these flu-prone areas during the rainy season</label></h2>\n<p>Take precautions this rainy season by following these extremely effective tips</p>\n<div class=\"col-md-12 sharer-container pad-0\"> </div>\n<img src=\"images/bioflu/featured1.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">1</span><span class=\"box-red-text\">Cleanliness is close to healthiness</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way1.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Remember to sanitize your office workspace each day to avoid getting or spreading germs and viruses. Considesadr the office as a public place. Consider the office as a public place. It\'s guaranteed that other people will be touching things on your deskp&gt;\n</p></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">2</span> <span class=\"box-red-text\">Your heart wants you to have a hearth</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way2.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Give your heart what it needs. Spend at least 15 to 30 minutes on cardio work out before going to work. This will not only help with blood circulation but your immunty as wellp&gt;\n</p></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">3</span> <span class=\"box-red-text\">Hand it to yourself</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way3.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Always clean your hands before meals. The hands are perfect carriers for germs and viruses - espicially if you\'ve spent a great deal of time outside your homep&gt;\n</p></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">4</span> <span class=\"box-red-text\">Be a Ninja</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way4.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Avoid heavily crowded places during the rainy season. Crowded places usually mean more germs and more viruses. Spend more time in open spaces with less peoplep&gt;\n</p></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">5</span> <span class=\"box-red-text\">Give it a Shot</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way5.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Get a Flu shot at least once a year. In case you\'re already suffering from the many symptoms of a flu like coughing, sneezing and headaches, remember to take Bioflu</p>\n<label>Basta tinamaan ka with more than one sintomas ng flu, ang tama Bioflu</label></div>\n<div class=\"col-md-12 sharer-container\"> </div>\n</div>', '', '1', '8', '2015-08-13 07:26:37', '346', '', '2015-09-23 12:33:05', '346', '0', '0000-00-00 00:00:00', '2015-09-09 07:53:35', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', '11', '2', '', '', '1', '347', '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', '0', '*', '', 'images/bioflu/featured1.png');
INSERT INTO `bio_content` VALUES ('16', '90', 'How the Flu Is Spread from Person to Person', 'how-the-flu-is-spread-from-person-to-person', '<div class=\"col-md-8 articles\">\n<div class=\"col-md-12\">\n<h2><label>How the Flu Is Spread from Person to Person<br></label></h2>\n<p>Take precautions this rainy season by following these extremely effective tips</p>\n<div class=\"col-md-12 sharer-container pad-0\">&nbsp;</div>\n<img src=\"images/bioflu/featured2.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">1</span> <span class=\"box-red-text\">Cleanliness is close to healthiness</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way1.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Remember to sanitize your office workspace each day to avoid getting or spreading germs and viruses. Considesadr the office as a public place. Consider the office as a public place. It\'s guaranteed that other people will be touching things on your deskp&gt;\n</p></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">2</span> <span class=\"box-red-text\">Your heart wants you to have a hearth</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way2.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Give your heart what it needs. Spend at least 15 to 30 minutes on cardio work out before going to work. This will not only help with blood circulation but your immunty as wellp&gt;\n</p></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">3</span> <span class=\"box-red-text\">Hand it to yourself</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way3.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Always clean your hands before meals. The hands are perfect carriers for germs and viruses - espicially if you\'ve spent a great deal of time outside your homep&gt;\n</p></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">4</span> <span class=\"box-red-text\">Be a Ninja</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way4.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Avoid heavily crowded places during the rainy season. Crowded places usually mean more germs and more viruses. Spend more time in open spaces with less peoplep&gt;\n</p></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">5</span> <span class=\"box-red-text\">Give it a Shot</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way5.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Get a Flu shot at least once a year. In case you\'re already suffering from the many symptoms of a flu like coughing, sneezing and headaches, remember to take Bioflu</p>\n<label>Basta tinamaan ka with more than one sintomas ng flu, ang tama Bioflu</label></div>\n<div class=\"col-md-12 sharer-container\">&nbsp;</div>\n</div>', '', '1', '8', '2015-08-13 07:33:48', '346', '', '2015-09-23 12:34:48', '346', '0', '0000-00-00 00:00:00', '2015-09-09 07:53:35', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', '4', '1', '', '', '1', '95', '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', '0', '*', '', 'images/bioflu/featured2.png');
INSERT INTO `bio_content` VALUES ('17', '91', 'There\'s no such thing as a little flu', 'there\'s-no-such-thing-as-a-little-flu', '<div class=\"col-md-8 articles\">\n<div class=\"col-md-12\">\n<h2><label>THERE\'S NO SUCH THING AS A LITTLE FLU<br /></label></h2>\n<p>Take precautions this rainy season by following these extremely effective tips</p>\n<div class=\"col-md-12 sharer-container pad-0\">Â </div>\n<img src=\"images/bioflu/featured3.png\" alt=\"\" width=\"100%\" /></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">1</span> <span class=\"box-red-text\">Cleanliness is close to healthiness</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way1.png\" alt=\"\" width=\"100%\" /></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Remember to sanitize your office workspace each day to avoid getting or spreading germs and viruses. Considesadr the office as a public place. Consider the office as a public place. It\'s guaranteed that other people will be touching things on your desk.</p>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">2</span> <span class=\"box-red-text\">Your heart wants you to have a hearth</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way2.png\" alt=\"\" width=\"100%\" /></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Give your heart what it needs. Spend at least 15 to 30 minutes on cardio work out before going to work. This will not only help with blood circulation but your immunty as well.</p>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">3</span> <span class=\"box-red-text\">Hand it to yourself</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way3.png\" alt=\"\" width=\"100%\" /></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Always clean your hands before meals. The hands are perfect carriers for germs and viruses - espicially if you\'ve spent a great deal of time outside your home.</p>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">4</span> <span class=\"box-red-text\">Be a Ninja</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way4.png\" alt=\"\" width=\"100%\" /></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Avoid heavily crowded places during the rainy season. Crowded places usually mean more germs and more viruses. Spend more time in open spaces with less people.</p>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">5</span> <span class=\"box-red-text\">Give it a Shot</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way5.png\" alt=\"\" width=\"100%\" /></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Get a Flu shot at least once a year. In case you\'re already suffering from the many symptoms of a flu like coughing, sneezing and headaches, remember to take Bioflu</p>\n<label>Basta tinamaan ka with more than one sintomas ng flu, ang tama Bioflu.</label></div>\n<div class=\"col-md-12 sharer-container\">Â </div>\n</div>', '', '1', '8', '2015-08-13 07:37:08', '346', '', '2015-09-23 12:35:43', '346', '0', '0000-00-00 00:00:00', '2015-08-13 07:37:08', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"