your hands before meals. The hands are perfect carriers for germs and viruses - espicially if you\'ve spent a great deal of time outside your homep&gt;\n</p></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">4</span> <span class=\"box-red-text\">Be a Ninja</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way4.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Avoid heavily crowded places during the rainy season. Crowded places usually mean more germs and more viruses. Spend more time in open spaces with less peoplep&gt;\n</p></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<h3><span class=\"box-red\">5</span> <span class=\"box-red-text\">Give it a Shot</span></h3>\n</div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\"><img src=\"images/bioflu/way5.png\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-12\" style=\"margin-top: 10px;\">\n<p>Get a Flu shot at least once a year. In case you\'re already suffering from the many symptoms of a flu like coughing, sneezing and headaches, remember to take Bioflu</p>\n<label>Basta tinamaan ka with more than one sintomas ng flu, ang tama Bioflu</label></div>\n<div class=\"col-md-12 sharer-container\"> </div>\n</div>', '', '1', '8', '2015-09-09 07:53:35', '346', '', '2015-09-23 12:37:31', '346', '0', '0000-00-00 00:00:00', '2015-09-09 07:53:35', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\"