INSERT INTO `bio_extensions` VALUES ('10008', 'System - Google Maps', 'plugin', 'plugin_googlemap3', 'system', '0', '1', '1', '0', '{\"name\":\"System - Google Maps\",\"type\":\"plugin\",\"creationDate\":\"July 2014\",\"author\":\"Mike Reumer\",\"copyright\":\"(C) 2014 Reumer\",\"authorEmail\":\"tech@reumer.net\",\"authorUrl\":\"tech.reumer.net\",\"version\":\"3.3\",\"description\":\"PLUGIN_GOOGLE_MAP3_INSTALLATION\",\"group\":\"\",\"filename\":\"plugin_googlemap3\"}', '{\"debug\":\"0\",\"plugincode\":\"mosmap\",\"brackets\":\"{\",\"Google_API_version\":\"3\",\"visualrefresh\":\"0\",\"signedin\":\"0\",\"show\":\"1\",\"mapclass\":\"\",\"mapprint\":\"icon\",\"mapcss\":\"\\/* For img in the map remove borders, shadow, no margin and no max-width\\r\\n*\\/\\r\\n.map img, .svPanel img {\\r\\n    border: 0px;\\r\\n    box-shadow: none;\\r\\n    margin: 0px !important;\\r\\n    padding: 0px !important;\\r\\n    max-width: none !important;\\r\\n    background: none !important;\\r\\n}\\r\\n\\r\\n\\/* Make sure the directions are below the map\\r\\n*\\/\\r\\n.directions {\\r\\n    clear: left;\\r\\n}\\r\\n\\r\\n.adp-directions {\\r\\n    width: 100%;\\r\\n}\\r\\n\\r\\n\\/* Solve problems in chrome with the show of the direction steps in full width\\r\\n*\\/\\r\\n.adp-placemark {\\r\\n    width : 100%;\\r\\n}\\r\\n\\r\\n\\/* Padding for image overlay\\r\\n*\\/\\r\\n.controlDiv {\\r\\n    padding : 5px;\\r\\n}\\r\\n\",\"loadmootools\":\"1\",\"timeinterval\":\"500\",\"Google_API_key\":\"\",\"Google_Multi_API_key\":\"\",\"urlsetting\":\"http_host\",\"googlewebsite\":\"maps.google.com\",\"styledmap\":\"\",\"align\":\"center\",\"langtype\":\"site\",\"lang\":\"\",\"width\":\"500\",\"height\":\"400\",\"effect\":\"none\",\"lat\":\"52.075581\",\"lon\":\"4.541513\",\"centerlat\":\"\",\"centerlon\":\"\",\"address\":\"\",\"geoloc\":\"0\",\"geocenter\":\"0\",\"controltype\":\"UI\",\"zoomType\":\"3D-large\",\"svcontrol\":\"1\",\"returncontrol\":\"1\",\"zoom\":\"10\",\"corzoom\":\"0\",\"minzo