INSERT INTO `bio_modules` VALUES ('107', '100', 'HOME', '', '<div class=\"homepage-container\">\n<div class=\"col-md-12 text-center banner-head-caption\">\n<h3>Para sa more than one sintomas ng flu, ang tama</h3>\n<h2><label>All-In-One BIOFLU</label></h2>\n</div>\n<div class=\"col-md-12 pad-0\"><img src=\"images/bioflu/templates/homebanner.jpg\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-4 pad-0 border news-container\">\n<div class=\"col-md-12\"><img src=\"images/bioflu/templates/news.png\" alt=\"\"></div>\n<div class=\"col-md-12\"><label>Flu News</label></div>\n<div class=\"col-md-12\"><p>Stay updated on the latest in health news</p></div>\n<div class=\"col-md-12\"><a class=\"btn btn-primary btn-news\" href=\"featured-articles\">Read</a></div>\n</div>\n<div class=\"col-md-4 pad-0 border flumonitor-container\">\n<div class=\"col-md-12\"><img width=\"102px\" src=\"images/bioflu/templates/flumonitor-icon.png\" alt=\"\"></div>\n<div class=\"col-md-12\"><label>National Flu Monitor</label></div>\n<div class=\"col-md-12\"><p>Fint out where the flu lingers with our flu activity tracker</p></div>\n<div class=\"col-md-12\"><a class=\"btn btn-primary btn-discover\" href=\"flu-monitor\">Launch App</a></div>\n&nbsp;</div>\n\n<div class=\"col-md-4 pad-0 border knowledge-container\">\n<div class=\"col-md-12\"><img src=\"images/bioflu/templates/knowledge.png\" alt=\"\"></div>\n<div class=\"col-md-12\"><label>Flu Knowledge</label></div>\n<div class=\"col-md-12\"><p>Learn more about the flue and the All-In-One solution to multi-symptom flue</p></div>\n<div class=\"col-md-12\"><a class=\"btn btn-primary btn-discover\" href=\"bioflu-information\">Discover</a></div>\n&nbsp;</div>\n</div>', '1', 'position-3', '0', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '1', 'mod_custom', '1', '1', '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"m