INSERT INTO `bio_modules` VALUES ('113', '110', 'FLU MONITOR TITLE', '', '<div class=\"col-md-12\">\r\n<div class=\"col-md-2\">Â </div>\r\n<div class=\"col-md-8 txt-center\">\r\n<div class=\"col-md-12 margin-top-10 flu-monitor-resp\" style=\"line-height: 28px;\">\r\n<p style=\"margin: 0px; font-size: 50px; color: #fe7773; font-weight: bold;\">FLU MONITOR</p>\r\n<label class=\"margin-0 flu-monitor-resp-label\">KEEPING THE HIGHLY CONTAGIOUS FLU IN CHECK</label></div>\r\n<div class=\"col-md-12 flu-monitor-resp-text\">\r\n<p>The Flu Monitor System is the first online flu tracker in the Philippines. It allows you to track flu outbreaks and report flu cases real-time! Get useful tips and find out how you can participate <a href=\"#trgt\">here.</a></p>\r\n<p>Â </p>\r\n</div>\r\n</div>\r\n<div class=\"col-md-2\">Â </div>\r\n</div>', '1', 'position-1', '0', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '1', 'mod_custom', '1', '1', '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', '0', '*');
INSERT INTO `bio_modules` VALUES ('114', '111', 'ALL ABOUT BIOFLUâ€™S FLU MONITOR SYSTEM', '', '<div class=\"col-md-12 margin-top-10\">\n<div class=\"col-md-12\"><label>ALL ABOUT BIOFLUâ€™S FLU MONITOR SYSTEM</label></div>\n<div class=\"col-md-12\"><label class=\"margin-0\">WHAT IS THE FLU MONITOR SYSTEM?</label>\n<p class=\"margin-0\">Flu Monitor is the first online flu tracker in the Philippines. The system aims to help track flu cases in the country and the different symptoms associated with it. The Flu Monitor enables people to take a more proactive approach to flu prevention by providing them a platform to report flu cases as well as to track it. </p>\n</div>\n<div class=\"col-md-12 margin-top-10\"><label class=\"margin-0\">HOW DOES IT WORK?</label>\n<p class=\"margin-0\">Flu monitor provides other important information apart from the flu cases in a given area. It also displays the following useful information: </p>\n<ul>\n<li>Drugstores â€“ because prevention is key, it is important that you take Bioflu at the onset of flu. The Flu Monitor shows the drugstore/s nearest your location you can buy Bioflu. It also displays the storeâ€™s complete address and operating hours for your convenience.</li>\n<li>Hospitals â€“ in case you need immediate medical attention, you can also refer to the Flu Monitor system to find out the hospital or clinic nearest you. </li>\n<li>Promotions â€“ Bioflu runs promotions from time to time. With the Flu Monitor, you can see which drugstores are running these promos. With these promos, you can get the best quality medicine at the best price.</li>\n</ul>\n</div>\n<div class=\"col-md-12\"><label class=\"margin-0\">GET INVOLVED!</label>\n<p class=\"margin-0\">Be proactive and get involved! Help stop the spread of the flu virus. You too can take part in two simple ways: </p>\n<p class=\"margin-0\">1. Report a case using Twitter â€“ if ever you spot a case of flu in your area, you simply tweet the multi-symptoms (example: cough &amp; colds, colds &amp; fever, cough &amp; body pain, etc.) and use the hashtag #FMSReportFlu. The flu monitor system will automatically pick up the case and map it in the system. </p>\n<p class=\"margin-0\">2. Report a case using the Flu Monitor System â€“ log on to www.bioflu.com/flumonitor. Report the case under â€œDO YOU THINK YOU HAVE A FLU?â€ section. Simply choose the symptoms (at least two), identify your area and click submit. </p>\n</div>\n<div class=\"col-md-12\">\n<p class=\"margin-0\" id=\"trgt\">Share and tell your friends about this so they too can be part of this move to track and manage flu cases in our country! </p>\n</div>\n</div>', '1', 'position-2', '346', '2015-09-16 08:28:59', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '1', 'mod_custom', '1', '1', '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', '0', '*');
INSERT INTO `bio_modules` VALUES ('115', '112', 'BIOFLU INFORMATION', '', '<div class=\"bioflu-container\">\n<div class=\"col-md-12 pad-0\">\n<div class=\"col-md-4 pad-0 bio-info-caption txt-center\">\n<h3>Para sa more than one na sintomas ng flu, ang tama</h3>\n<h2>All-In-One BIOFLU</h2>\n<img class=\"play-video\" src=\"images/bioflu/templates/bioflu-info-player.png\" alt=\"\" width=\"250px\" /></div>\n</div>\n<div class=\"col-md-12 pad-0\">\n<div class=\"col-md-12 pad-0 prod-info-header-resp\"><img src=\"images/bioflu/templates/product-info-header.png\" alt=\"\" width=\"100%\" /></div>\n<div class=\"col-md-12 pad-0 txt-center btn-arrow-down \"><img src=\"images/bioflu/templates/btn-arrow-down.png\" alt=\"\" /></div>\n</div>\n<div class=\"bottom-information\">\n<div class=\"col-md-12 pad-0\">\n<div class=\"col-md-6 txt-center top-50\"><img src=\"images/bioflu/templates/bioflu-tablet.png\" alt=\"\" /></div>\n<div class=\"col-md-6 top-50\">\n<h3 align=\"center\">What is in the all-in-one Bioflu?</h3>\n<p align=\"justify\">All-In-One Bioflu with Flutech formula is ideal for multi-symptom flu. It contains 10mg phenylephrine HCI, 2mg chlorphenamine maleate, and 500mg paracetamol in each caplet for fast relief of flu symptoms.</p>\n<p align=\"justify\">Phenylephrine HCI is a decongestant that clears clogged air passages while chlorphenamine maleate is an anti-allergy medicine used to relieve symptoms of flu like runny nose, sneezing and itchy watery eyes. Combined, they also reduce postnasal drip, preventing the development of sore throat and cough. Lastly, BIOFLU also contains paracetamol to help reduce fever and relieve body pains.</p>\n</div>\n</div>\n<div class=\"col-md-12 pad-0 flu-symptoms-container\">\n<div class=\"col-md-12 pad-0 txt-center\">\n<h3>KNOW YOUR FLU SYMPTOMS</h3>\n</div>\n<div class=\"col-md-12 pad-0\">\n<div class=\"col-md-2 pad-0\">Â </div>\n<div class=\"col-md-8 pad-0\">\n<div class=\"col-md-3 col-xs-6 col-sm-6    pad-25 txt-center\"><img src=\"images/bioflu/templates/fever.gif\" alt=\"\" width=\"100%\" /><label>FEVER</label></div>\n<div class=\"col-md-3 col-xs-6 col-sm-6     pad-25 txt-center\"><img src=\"images/bioflu/templates/itchy.gif\" alt=\"\" width=\"100%\" /><label>ITCHY WATERY EYES</label></div>\n<div class=\"col-md-3 col-xs-6 col-sm-6    pad-25 txt-center\"><img src=\"images/bioflu/templates/headaches.gif\" alt=\"\" width=\"100%\" /><label>HEADACHES AND/OR BODY ACHES</label></div>\n<div class=\"col-md-3 col-xs-6 col-sm-6    pad-25 txt-center\"><img src=\"images/bioflu/templates/fatigue.gif\" alt=\"\" width=\"100%\" /><label>FATIGUE</label></div>\n</div>\n<div class=\"col-md-2 pad-0\">Â </div>\n</div>\n<div class=\"col-md-12 pad-0\">\n<div class=\"col-md-2 pad-0\">Â </div>\n<div class=\"col-md-8 pad-0\">\n<div class=\"col-md-3 col-xs-6 col-sm-6    pad-25 txt-center\"><img src=\"images/bioflu/templates/chills.gif\" alt=\"\" width=\"100%\" /><label>CHILLS</label></div>\n<div class=\"col-md-3 col-xs-6 col-sm-6    pad-25 txt-center\"><img src=\"images/bioflu/templates/sneezing.gif\" alt=\"\" width=\"100%\" /><label>SNEEZING</label></div>\n<div class=\"col-md-3 col-xs-6 col-sm-6    pad-25 txt-center\"><img src=\"images/bioflu/templates/runny.gif\" alt=\"\" width=\"100%\" /><label>RUNNY OR STUFFY NOSE</label></div>\n<div class=\"col-md-3 col-xs-6 col-sm-6    pad-25 txt-center\"><img src=\"images/bioflu/templates/cough.gif\" alt=\"\" width=\"100%\" /><label>COUGH AND/OR SORE THROAT</label></div>\n</div>\n<div class=\"col-md-2 pad-0\">Â </div>\n</div>\n<div class=\"col-md-12\">\n<div class=\"col-md-4\">Â </div>\n<div class=\"col-md-4 note\">Note: Some people who have the flu may suffer from just 2 of the symptoms while others may suffer from all the symptoms.</div>\n<div class=\"col-md-4\">Â </div>\n</div>\n</div>\n<div class=\"col-md-12 pad-10 flu-graph-container\">\n<div class=\"col-md-6 pad-0\">\n<div class=\"col-md-12 pad-0\">\n<div class=\"col-md-12 \">\n<div class=\"col-md-1 col-xs-1 col-sm-1   pad-10\"><img src=\"images/bioflu/templates/yellow-bulb.png\" alt=\"\" /></div>\n<div class=\"col-md-11 col-xs-11 col-sm-11    \"><label class=\"yellow h3\">DID YOU KNOW?</label></div>\n</div>\n<div class=\"col-md-12 pad-left-right-30\">\n<h4 class=\"white\">MORE THAN ONE SYMPTOM DOES NOT MEAN MORE THAN ONE ILLNESS</h4>\n<p class=\"white\">Careful assessment is a must when it comes to the flu. If you experience more than one symptom, like cough and chills, you have most likely contracted the flue. In these instances, take BIOFLU immediately to avoid the total onset of the flu</p>\n</div>\n</div>\nÂ </div>\n<div class=\"col-md-6 pad-0 txt-center\"><img src=\"images/bioflu/templates/flu-graph.png\" alt=\"\" /></div>\n</div>\n<div class=\"col-md-12 pad-10 medicine-container\">\n<div class=\"col-md-3\"><img src=\"images/bioflu/templates/take-medicine.gif\" alt=\"\" /></div>\n<div class=\"col-md-9\">\n<div class=\"col-md-12\">\n<h3>How often should you use the medicine?</h3>\n<p>For 12 years and above, take 1 caplet orally every 6 hours or as recommended by a doctor. If you miss a dose, simply take the next dose until symptoms being treated are gone. For children under 12 year old, there\'s Children\'s Bioflu.</p>\n</div>\n<div class=\"col-md-12\"><img src=\"images/bioflu/templates/12yearold.png\" alt=\"\" width=\"100%\" /></div>\n<div class=\"col-md-12\"><img src=\"images/bioflu/templates/7yearold.png\" alt=\"\" width=\"100%\" /></div>\n<div class=\"col-md-12\"><img src=\"images/bioflu/templates/2yearold.png\" alt=\"\" width=\"100%\" /></div>\n</div>\n</div>\n<div class=\"col-md-12 pad-10 medicine-container\">\n<div class=\"col-md-3\"><img src=\"images/bioflu/templates/consult-doctor.gif\" alt=\"\" /></div>\n<div class=\"col-md-9 pad-10\">\n<div class=\"col-md-6 pad-10\"><label>When not to take BIOFLU</label>\n<ul>\n<li>If you are allergic to any of the ingredients in the product</li>\n<li>If you have high blood pressure or severe heart disease</li>\n<li>If you have anemia, kidney or liver disease</li>\n<li>If you are pregnant or breastfeeding</li>\n</ul>\nÂ </div>\n<div class=\"col-md-6 pad-10\"><label>When to consult a doctor</label>\n<p>Before taking this medication, tell your doctor if you have:</p>\n<ul>\n<li>High Blood</li>\n<li>Glaucoma</li>\n<li>Thyroid problems</li>\n<li>Diabetes</li>\n<li>Liver or kidney disease</li>\n<li>An enlarged prostate</li>\n<li>Bladder problems / difficulty urinating</li>\n</ul>\n</div>\n</div>\n</div>\n<div class=\"col-md-12 txt-center overdose-container\">\n<h3>WARNINGS</h3>\n<label>SIGNS AND SYMPTOMS OF OVERDOSAGE</label></div>\n<div class=\"col-md-12 overdose-container\">\n<div class=\"col-md-6 paracetamol\"><label>Paracetamol</label> <label>Overdosage of paracetamol usually involves 4 phases with the following signs and symptoms:</label>\n<ul>\n<li>Eating disorder, nausea, vomiting, malaise, and excessive sweating</li>\n<li>Right upper abdominal pain and tenderness, liver enlargement which may be characterized by abdominal discomfort of \"feeling full\", elevated bilirubin and liver enzyme concentrations, prolongation of prothrombin time, and occasionally decreased urine output.</li>\n<li>Eating disorder, nausea, vomiting, malaise recur and signs of liver (e.g., jaundice) and possibly kidney failure</li>\n<li>Recovery or progression to fatal complete liver failure</li>\n</ul>\n</div>\n<div class=\"col-md-3 maleate\"><label>Chlorphenamine maleate</label>\n<ul>\n<li>Extreme sleepiness or prolonged drowsiness</li>\n<li>Weakness</li>\n<li>Hallucination</li>\n<li>Convulsion</li>\n<li>Agitation</li>\n<li>Irritability</li>\n<li>Tachycardia</li>\n<li>Coma</li>\n</ul>\n</div>\n<div class=\"col-md-3 hci\"><label>Phenylephrine HCl</label>\n<ul>\n<li>Increased blood pressure</li>\n<li>Headache</li>\n<li>Seizures</li>\n<li>Palpitation</li>\n<li>Paresthesia (sensation of tingling, pricking, or numbness of the skin)</li>\n<li>Vomiting</li>\n<li>Cerebral hemorrhage (bleeding from a ruptured blood vessel in the brain)</li>\n</ul>\n</div>\n</div>\n</div>\n</div>', '1', 'position-2', '0', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '1', 'mod_custom', '1', '1', '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', '0', '*');
