INSERT INTO `bio_modulestest` VALUES ('107', '18', 'HOME', '', '<div class=\"homepage-container\">\n<div class=\"col-md-12 text-center banner-head-caption\">\n<h3>Para sa more than one sintomas ng flu, ang tama</h3>\n<h2><label>All-In-One BIOFLU</label></h2>\n</div>\n<div class=\"col-md-12 pad-0\"><img src=\"images/bioflu/templates/homebanner.jpg\" alt=\"\" width=\"100%\"></div>\n<div class=\"col-md-6 pad-0 border news-container\">\n<div class=\"col-md-12\"><img src=\"images/bioflu/templates/news.png\" alt=\"\"></div>\n<div class=\"col-md-12\"><label>Flu News</label></div>\n<div class=\"col-md-12\">\n<p>Stay updated on the latest in health news</p>\n</div>\n<div class=\"col-md-12 pad-10\"><a class=\"btn btn-primary btn-news\" href=\"featured-articles\">Read</a></div>\n</div>\n<div class=\"col-md-6 pad-0 border knowledge-container\">\n<div class=\"col-md-12\"><img src=\"images/bioflu/templates/knowledge.png\" alt=\"\"></div>\n<div class=\"col-md-12\"><label>Flu Knowledge</label></div>\n<div class=\"col-md-12\">\n<p>Learn more about the flue and the All-In-One solution to multi-symptom flue</p>\n</div>\n<div class=\"col-md-12 pad-10\"><a class=\"btn btn-primary btn-discover\" href=\"bioflu-information\">Discover</a></div>\n&nbsp;</div>\n</div>', '0', '', '0', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', null, '0', '1', '', '0', '');
