INSERT INTO `bio_ucm_history` VALUES ('202', '14', '1', '', '2015-09-04 15:03:59', '346', '9817', '3782a48f392b84ecf4989ef7c77805fd088aa57d', '{\"id\":14,\"asset_id\":\"85\",\"title\":\"Bioflu Information\",\"alias\":\"bioflu-information\",\"introtext\":\"<div class=\\\"bioflu-container\\\">\\r\\n<div class=\\\"col-md-12 pad-0\\\">\\r\\n<div class=\\\"col-md-4 pad-0 bio-info-caption txt-center\\\">\\r\\n<h3>Para sa more than one na sintomas ng flu, ang tama<\\/h3>\\r\\n<h2>All-In-One BIOFLU<\\/h2>\\r\\n<img src=\\\"images\\/bioflu\\/templates\\/bioflu-info-player.png\\\" alt=\\\"\\\" width=\\\"250px\\\" \\/><\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12 pad-0\\\">\\r\\n<div class=\\\"col-md-12 pad-0\\\"><img src=\\\"images\\/bioflu\\/templates\\/product-info-header.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-12 pad-0 txt-center\\\"><img class=\\\"btn-arrow-down\\\" src=\\\"images\\/bioflu\\/templates\\/btn-arrow-down.png\\\" alt=\\\"\\\" \\/><\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12 pad-0\\\">\\r\\n<div class=\\\"col-md-6 txt-center top-50\\\"><img src=\\\"images\\/bioflu\\/templates\\/bioflu-tablet.png\\\" alt=\\\"\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-6 top-50\\\">\\r\\n<h3 align=\\\"center\\\">What is in the all-in-one Bioflu?<\\/h3>\\r\\n<p align=\\\"justify\\\">All-In-One Bioflu with Flutech formula is ideal for multi-symptom flu. It contains 10mg phenylephrine HCI, 2mg chlorphenamine maleate, and 500mg paracetamol in each caplet for fast relief of flu symptoms.<\\/p>\\r\\n<p align=\\\"justify\\\">Phenylephrine HCI is a decongestant that clears clogged air passages and reduces postnasal drip preventing the development of sore throat and cough - while chlorphenamine maleate is anti-allergy medicine used to relieve symptoms like runny nose, sneezing, and itchy watery eyes. Lastly, BIOFLU also contains paracetamol to help reduce fever and relieve body pains.<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12 pad-0 flu-symptoms-container\\\">\\r\\n<div class=\\\"col-md-12 pad-0 txt-center\\\">\\r\\n<h3>KNOW YOUR FLU SYMPTOMS<\\/h3>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12 pad-0\\\">\\r\\n<div class=\\\"col-md-2 pad-0\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"col-md-8 pad-0\\\">\\r\\n<div class=\\\"col-md-3 pad-25 txt-center\\\"><img src=\\\"images\\/bioflu\\/templates\\/fever.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><label>FEVER<\\/label><\\/div>\\r\\n<div class=\\\"col-md-3 pad-25 txt-center\\\"><img src=\\\"images\\/bioflu\\/templates\\/itchy.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><label>ITCHY WATERY EYES<\\/label><\\/div>\\r\\n<div class=\\\"col-md-3 pad-25 txt-center\\\"><img src=\\\"images\\/bioflu\\/templates\\/headaches.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><label>HEADACHES AND\\/OR BODY ACHES<\\/label><\\/div>\\r\\n<div class=\\\"col-md-3 pad-25 txt-center\\\"><img src=\\\"images\\/bioflu\\/templates\\/fatigue.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><label>FATIGUE<\\/label><\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-2 pad-0\\\">\\u00a0<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12 pad-0\\\">\\r\\n<div class=\\\"col-md-2 pad-0\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"col-md-8 pad-0\\\">\\r\\n<div class=\\\"col-md-3 pad-25 txt-center\\\"><img src=\\\"images\\/bioflu\\/templates\\/chills.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><label>CHILLS<\\/label><\\/div>\\r\\n<div class=\\\"col-md-3 pad-25 txt-center\\\"><img src=\\\"images\\/bioflu\\/templates\\/sneezing.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><label>SNEEZING<\\/label><\\/div>\\r\\n<div class=\\\"col-md-3 pad-25 txt-center\\\"><img src=\\\"images\\/bioflu\\/templates\\/runny.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><label>RUNNY OR STUFFY NOSE<\\/label><\\/div>\\r\\n<div class=\\\"col-md-3 pad-25 txt-center\\\"><img src=\\\"images\\/bioflu\\/templates\\/cough.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><label>COUGH AND\\/OR SORE THROAT<\\/label><\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-2 pad-0\\\">\\u00a0<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12\\\">\\r\\n<div class=\\\"col-md-4\\\">\\u00a0<\\/div>\\r\\n<div class=\\\"col-md-4 note\\\">Note: Some people who have the flu may suffer from just 2 of the symptoms while others may suffer from all the symptoms.<\\/div>\\r\\n<div class=\\\"col-md-4\\\">\\u00a0<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12 pad-10 flu-graph-container\\\">\\r\\n<div class=\\\"col-md-6 pad-0\\\">\\r\\n<div class=\\\"col-md-12 pad-0\\\">\\r\\n<div class=\\\"col-md-12 \\\">\\r\\n<div class=\\\"col-md-1 pad-10\\\"><img src=\\\"images\\/bioflu\\/templates\\/yellow-bulb.png\\\" alt=\\\"\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-11 \\\"><label class=\\\"yellow h3\\\">DID YOU KNOW?<\\/label><\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12 pad-left-right-30\\\">\\r\\n<h4 class=\\\"white\\\">MORE THAN ONE SYMPTOM DOES NOT MEAN MORE THAN ONE ILLNESS<\\/h4>\\r\\n<p class=\\\"white\\\">Careful assessment is a must when it comes to the flu. If you experience more than one symptom, like cough and chills, you have most likely contracted the flue. In these instances, take BIOFLU immediately to avoid the total onset of the flu<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n\\u00a0<\\/div>\\r\\n<div class=\\\"col-md-6 pad-0 txt-center\\\"><img src=\\\"images\\/bioflu\\/templates\\/flu-graph.png\\\" alt=\\\"\\\" \\/><\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12 pad-10 medicine-container\\\">\\r\\n<div class=\\\"col-md-3\\\"><img src=\\\"images\\/bioflu\\/templates\\/take-medicine.png\\\" alt=\\\"\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-9\\\">\\r\\n<div class=\\\"col-md-12\\\">\\r\\n<h3>How often should you use the medicine?<\\/h3>\\r\\n<p>For 12 years and above, take 1 caplet orally every 6 hours or as recommended by a doctor. If you miss a dose, simply take the next dose until symptoms being treated are gone. For children under 12 year old, there\'s Children\'s Bioflu.<\\/p>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12\\\"><img src=\\\"images\\/bioflu\\/templates\\/12yearold.png\\\" alt=\\\"\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-12\\\"><img src=\\\"images\\/bioflu\\/templates\\/7yearold.png\\\" alt=\\\"\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-12\\\"><img src=\\\"images\\/bioflu\\/templates\\/2yearold.png\\\" alt=\\\"\\\" \\/><\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12 pad-10 medicine-container\\\">\\r\\n<div class=\\\"col-md-3\\\"><img src=\\\"images\\/bioflu\\/templates\\/consult-doctor.png\\\" alt=\\\"\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-9 pad-10\\\">\\r\\n<div class=\\\"col-md-6 pad-10\\\"><label>When not to take BIOFLU<\\/label>\\r\\n<ul>\\r\\n<li>If you are allergic to any of the ingredients in the product<\\/li>\\r\\n<li>If you have high blood pressure or severe heart disease<\\/li>\\r\\n<li>If you have anemia, kidney or liver disease<\\/li>\\r\\n<li>If you are pregnant or breastfeeding<\\/li>\\r\\n<\\/ul>\\r\\n\\u00a0<\\/div>\\r\\n<div class=\\\"col-md-6 pad-10\\\"><label>When to consult a doctor<\\/label>\\r\\n<p>Before taking this medication, tell your doctor if you have:<\\/p>\\r\\n<ul>\\r\\n<li>High Blood<\\/li>\\r\\n<li>Glaucoma<\\/li>\\r\\n<li>Thyroid problems<\\/li>\\r\\n<li>Diabetes<\\/li>\\r\\n<li>Liver or kidney disease<\\/li>\\r\\n<li>An enlarged prostate<\\/li>\\r\\n<li>Bladder problems \\/ difficulty urinating<\\/li>\\r\\n<\\/ul>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12 txt-center overdose-container\\\">\\r\\n<h3>WARNINGS<\\/h3>\\r\\n<label>SIGNS AND SYMPTOMS OF OVERDOSAGE<\\/label><\\/div>\\r\\n<div class=\\\"col-md-12 overdose-container\\\">\\r\\n<div class=\\\"col-md-6 paracetamol\\\"><label>Paracetamol<\\/label> <label>Overdosage of paracetamol usually involves 4 phases with the following signs and symptoms:<\\/label>\\r\\n<ul>\\r\\n<li>Eating disorder, nausea, vomiting, malaise, and excessive sweating<\\/li>\\r\\n<li>Right upper abdominal pain and tenderness, liver enlargement which may be characterized by abdominal discomfort of \\\"feeling full\\\", elevated bilirubin and liver enzyme concentrations, prolongation of prothrombin time, and occasionally decreased urine output.<\\/li>\\r\\n<li>Eating disorder, nausea, vomiting, malaise recur and signs of liver (e.g., jaundice) and possibly kidney failure<\\/li>\\r\\n<li>Recovery or progression to fatal complete liver failure<\\/li>\\r\\n<\\/ul>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-3 maleate\\\"><label>Chlorphenamine maleate<\\/label>\\r\\n<ul>\\r\\n<li>Extreme sleepiness or prolonged drowsiness<\\/li>\\r\\n<li>Weakness<\\/li>\\r\\n<li>Hallucination<\\/li>\\r\\n<li>Convulsion<\\/li>\\r\\n<li>Agitation<\\/li>\\r\\n<li>Irritability<\\/li>\\r\\n<li>Tachycardia<\\/li>\\r\\n<li>Coma<\\/li>\\r\\n<\\/ul>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-3 hci\\\"><label>Phenylephrine HCl<\\/label>\\r\\n<ul>\\r\\n<li>Increased blood pressure<\\/li>\\r\\n<li>Headache<\\/li>\\r\\n<li>Seizures<\\/li>\\r\\n<li>Palpitation<\\/li>\\r\\n<li>Paresthesia (sensation of tingling, pricking, or numbness of the skin)<\\/li>\\r\\n<li>Vomiting<\\/li>\\r\\n<li>Cerebral hemorrhage (bleeding from a ruptured blood vessel in the brain)<\\/li>\\r\\n<\\/ul>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"2\",\"created\":\"2015-08-10 17:04:39\",\"created_by\":\"346\",\"created_by_alias\":\"\",\"modified\":\"2015-09-04 15:03:59\",\"modified_by\":\"346\",\"checked_out\":\"346\",\"checked_out_time\":\"2015-09-04 15:00:48\",\"publish_up\":\"2015-08-10 17:04:39\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta