INSERT INTO `bio_ucm_history` VALUES ('251', '62', '1', '', '2015-09-24 07:56:55', '346', '5156', '8dff5948a9b8295f7ae8eb31288cf4328220acdd', '{\"id\":62,\"asset_id\":\"104\",\"title\":\"8 Reasons Your Cough Is Not Improving \",\"alias\":\"8-reasons-your-cough-is-not-improving\",\"introtext\":\"<div class=\\\"col-md-8 articles\\\">\\r\\n<div class=\\\"col-md-12\\\">\\r\\n<h2><label>8 Reasons Your Cough Is Not Improving <\\/label><\\/h2>\\r\\n<p>Take precautions this rainy season by following these extremely effective tips<\\/p>\\r\\n<div class=\\\"col-md-12 sharer-container pad-0\\\">\\u00a0<\\/div>\\r\\n<img src=\\\"images\\/bioflu\\/featured4.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\">\\r\\n<h3><span class=\\\"box-red\\\">1<\\/span> <span class=\\\"box-red-text\\\">Cleanliness is close to healthiness<\\/span><\\/h3>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\"><img src=\\\"images\\/bioflu\\/way1.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\">\\r\\n<p>Remember to sanitize your office workspace each day to avoid getting or spreading germs and viruses. Considesadr the office as a public place. Consider the office as a public place. It\'s guaranteed that other people will be touching things on your deskp&gt;<\\/p>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\">\\r\\n<h3><span class=\\\"box-red\\\">2<\\/span> <span class=\\\"box-red-text\\\">Your heart wants you to have a hearth<\\/span><\\/h3>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\"><img src=\\\"images\\/bioflu\\/way2.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\">\\r\\n<p>Give your heart what it needs. Spend at least 15 to 30 minutes on cardio work out before going to work. This will not only help with blood circulation but your immunty as wellp&gt;<\\/p>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\">\\r\\n<h3><span class=\\\"box-red\\\">3<\\/span> <span class=\\\"box-red-text\\\">Hand it to yourself<\\/span><\\/h3>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\"><img src=\\\"images\\/bioflu\\/way3.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\">\\r\\n<p>Always clean your hands before meals. The hands are perfect carriers for germs and viruses - espicially if you\'ve spent a great deal of time outside your homep&gt;<\\/p>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\">\\r\\n<h3><span class=\\\"box-red\\\">4<\\/span> <span class=\\\"box-red-text\\\">Be a Ninja<\\/span><\\/h3>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\"><img src=\\\"images\\/bioflu\\/way4.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\">\\r\\n<p>Avoid heavily crowded places during the rainy season. Crowded places usually mean more germs and more viruses. Spend more time in open spaces with less peoplep&gt;<\\/p>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\">\\r\\n<h3><span class=\\\"box-red\\\">5<\\/span> <span class=\\\"box-red-text\\\">Give it a Shot<\\/span><\\/h3>\\r\\n<\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\"><img src=\\\"images\\/bioflu\\/way5.png\\\" alt=\\\"\\\" width=\\\"100%\\\" \\/><\\/div>\\r\\n<div class=\\\"col-md-12\\\" style=\\\"margin-top: 10px;\\\">\\r\\n<p>Get a Flu shot at least once a year. In case you\'re already suffering from the many symptoms of a flu like coughing, sneezing and headaches, remember to take Bioflu<\\/p>\\r\\n<label>Basta tinamaan ka with more than one sintomas ng flu, ang tama Bioflu<\\/label><\\/div>\\r\\n<div class=\\\"col-md-12 sharer-container\\\">\\u00a0<\\/div>\\r\\n<\\/div>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2015-09-09 07:50:24\",\"created_by\":\"346\",\"created_by_alias\":\"\",\"modified\":\"2015-09-24 07:56:55\",\"modified_by\":\"346\",\"checked_out\":\"346\",\"checked_out_time\":\"2015-09-24 07:56:47\",\"publish_up\":\"2015-09-09 07:53:35\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_layout\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":10,\"ordering\":\"0\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"21\",\"metadata\":\"{\\\"robots\\\":